[property.https.html]
  expected: TIMEOUT
  [cross-origin > w => w.blur()]
    expected: FAIL

  [cross-origin > w => w.close()]
    expected:
      if webrender and not debug: ["FAIL", "TIMEOUT"]
      FAIL

  [same-site > w => w.opener]
    expected: NOTRUN

  [same-site > w => w.window]
    expected: NOTRUN

  [same-site > w => w.blur()]
    expected: NOTRUN

  [same-site > w => w.focus()]
    expected: NOTRUN

  [cross-origin > w => w.postMessage("", "")]
    expected: NOTRUN

  [cross-origin > w => w.top]
    expected: NOTRUN

  [cross-origin > w => w.opener = ""]
    expected: NOTRUN

  [same-site > w => w.top]
    expected: NOTRUN

  [cross-origin > w => w.location]
    expected: NOTRUN

  [same-site > w => w["test"\]]
    expected: NOTRUN

  [cross-origin > w => w.location = "#"]
    expected: NOTRUN

  [cross-origin > w => w.length]
    expected: NOTRUN

  [same-site > w => w.opener = ""]
    expected: NOTRUN

  [same-site > w => w.postMessage("")]
    expected: NOTRUN

  [cross-origin > w => w.closed]
    expected:
      if not debug and (os == "linux") and webrender: ["TIMEOUT", "NOTRUN"]
      if not debug and (os == "linux") and not webrender: ["FAIL", "TIMEOUT"]
      if not debug and (os == "win"): ["TIMEOUT", "NOTRUN"]
      if not debug and (os == "mac"): TIMEOUT
      FAIL

  [same-site > w => w.location = "#"]
    expected: NOTRUN

  [cross-origin > w => w.self]
    expected: NOTRUN

  [same-site > w => w.postMessage("", "")]
    expected: NOTRUN

  [same-site > w => w.close()]
    expected: NOTRUN

  [same-site > w => w.frames]
    expected: NOTRUN

  [same-site > w => w.length]
    expected: NOTRUN

  [same-site > w => w.closed]
    expected: NOTRUN

  [same-site > w => w.self]
    expected: NOTRUN

  [cross-origin > w => w.opener]
    expected: NOTRUN

  [cross-origin > w => w.frames]
    expected:
      if debug and (os == "win") and not webrender and (processor == "x86"): FAIL
      if debug and (os == "win") and not webrender and (processor == "x86_64"): ["FAIL", "TIMEOUT"]
      if not debug and (os == "linux") and not webrender: ["FAIL", "TIMEOUT", "NOTRUN"]
      if debug and (os == "linux") and webrender: ["FAIL", "TIMEOUT"]
      if debug and (os == "linux") and not webrender: ["FAIL", "TIMEOUT"]
      if debug and (os == "win") and webrender: FAIL
      if debug and (os == "mac"): ["FAIL", "TIMEOUT", "NOTRUN"]
      NOTRUN

  [cross-origin > w => w[0\]]
    expected:
      if debug and (os == "win") and not webrender and (processor == "x86_64"): ["TIMEOUT", "NOTRUN"]
      if debug and (os == "win") and not webrender and (processor == "x86"): TIMEOUT
      if debug and (os == "linux") and webrender: ["TIMEOUT", "NOTRUN"]
      if debug and (os == "linux") and not webrender: TIMEOUT
      if debug and (os == "win") and webrender: TIMEOUT
      if not debug and (os == "linux") and not webrender: ["TIMEOUT", "NOTRUN"]
      if debug and (os == "mac"): ["TIMEOUT", "NOTRUN"]
      NOTRUN

  [same-site > w => w[0\]]
    expected: NOTRUN

  [same-site > w => w.location]
    expected: NOTRUN

  [cross-origin > w => w.focus()]
    expected:
      if not debug and not webrender and (os == "win") and (processor == "x86"): ["NOTRUN", "FAIL"]
      if not debug and not webrender and (os == "linux"): ["FAIL", "NOTRUN"]
      if debug and (os == "mac"): ["FAIL", "TIMEOUT"]
      if debug and (os == "win"): FAIL
      if debug and (os == "linux"): FAIL
      NOTRUN

  [cross-origin > w => w["test"\]]
    expected: NOTRUN

  [cross-origin > w => w.postMessage("")]
    expected: NOTRUN

  [cross-origin > w => w.window]
    expected: NOTRUN

